import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Open the cart modal (try clicking on the cart div by text "Cart")
    const cartSelector = '//div[contains(@class,"cart") and contains(normalize-space(.),"Cart")]';
    await page.waitForSelector(cartSelector, { timeout: 5000 });
    await page.click(cartSelector);

    // Wait for the cart modal to appear (look for "Your cart" or "empty-cart" or cart-item)
    // Try to find a cart item to remove
    let cartItemSelector = '.cart-item';
    await page.waitForSelector(cartItemSelector, { timeout: 5000 });

    // Take screenshot of cart before removal
    const step2 = path.join(screenshotsDir, 'step_2_cart_opened.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Find the first "Remove" button inside a cart item and click it
    // Use text selector for "Remove" button
    const removeBtnSelector = '//button[contains(@class,"remove-item") and (text()="Remove" or normalize-space(.)="Remove")]';
    await page.waitForSelector(removeBtnSelector, { timeout: 5000 });
    await page.click(removeBtnSelector);

    // Wait for the cart to update (cart-item may disappear or "Your cart is empty" appears)
    // Wait for either no cart-item or empty-cart message
    let cartEmpty = false;
    try {
      await page.waitForSelector('.empty-cart', { timeout: 5000 });
      cartEmpty = true;
    } catch {
      // If not empty, check if cart-item count decreased
      const items = await page.$$(cartItemSelector);
      cartEmpty = items.length === 0;
    }

    // Take screenshot after removal
    const step3 = path.join(screenshotsDir, 'step_3_item_removed.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract cart status text
    let cartStatusText = '';
    if (cartEmpty) {
      const emptyEl = await page.$('.empty-cart');
      if (emptyEl) {
        cartStatusText = (await emptyEl.textContent())?.trim();
      }
    } else {
      // If not empty, count remaining cart items
      const items = await page.$$(cartItemSelector);
      cartStatusText = `Cart items remaining: ${items.length}`;
    }

    return {
      success: true,
      action: "Removed an item from the cart using the Remove button in the cart modal",
      extractedData: {
        cartStatusText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
